import React from 'react';
import {
    FacebookIcon,
    TwitterIcon,
    RedditIcon,
    FacebookShareButton,
    TwitterShareButton,
    RedditShareButton
} from "react-share";

const SocialMedia = () => {

    
    return (
        <div>
            <FacebookShareButton children={<FacebookIcon />} url={'https://www.facebook.com/sharer/sharer.php?u=' + window.location} />
            <TwitterShareButton children={<TwitterIcon />} url={window.location.href} />
            <RedditShareButton children={<RedditIcon />} url={window.location.href} />
        </div>
    )
}

export default SocialMedia;
